Date.prototype.format=function(formation){var year=this.getFullYear(),month=this.getMonth()+1,date=this.getDate(),hour=this.getHours(),lhour=hour>12?hour-12:hour,minute=this.getMinutes(),second=this.getSeconds(),toTwoDigit=function(num){return num<10?"0"+num:num;},formatObj={yyyy:year,yy:year.toString().slice(2),MM:toTwoDigit(month),M:month,dd:toTwoDigit(date),d:date,HH:toTwoDigit(hour),H:hour,hh:toTwoDigit(lhour),h:lhour,mm:toTwoDigit(minute),m:minute,ss:toTwoDigit(second),s:second};return formation.replace(/y+|m+|d+|h+|s+|H+|M+/g,function($0){return formatObj[$0]||$0;});};
mui.fn.toArray=function(){return [].slice.call(this);}
mui.HEADER_HEIGHT='48px';
mui.FOOTER_HEIGHT='50px';
mui.ZERO_HEIGHT='0px';

var T = {
	KEY_CUSTOMER: 'customer',
	KEY_USER: 'user',
	setItemJSON: function(key, json) {
		plus.storage.setItem(key, JSON.stringify(json));
	},
	getItemJSON: function(key) {
		return mui.parseJSON(plus.storage.getItem(key));
	},
	
	DOMAIN: 'http://lifa.chengsekongjian.com',
	
	isLogin: function() {
		return !!plus.storage.getItem(this.KEY_USER);
	},

    _changeArgs: function(args) {
        args = [].slice.apply(args);
        if (args[0].indexOf('http://') !== 0) {
        	args[0] = T.DOMAIN + args[0];
        }
        var fn = mui.noop,
            extFn = function(json) {
            	alert(json)
            	json = JSON.parse(json);
                if (!json.status) {
                    fn(json.data);
                } else {
                    json.msg && mui.alert(json.msg);
                }
            };
        if (typeof args[1] === 'function') {
            fn = args[1];
            args[1] = extFn;
//          if (!args[2]) {
//              args.push('json');
//          }
        } else if (typeof args[2] === 'function') {
            fn = args[2];
            args[2] = extFn;
//          if (!args[3]) {
//              args.push('json');
//          }
        }

        return args;
    },

    get: function() {
        return $.get.apply(null, this._changeArgs(arguments));
    },

    post: function() {
        return $.post.apply(null, this._changeArgs(arguments));
    }
};
